import React, { Component } from "react";

const items = [
  {
    title: "How to prepare a great beer",
    type: "video",
    source: "facebook",
    videoId: "1052114818157758",
    views: 4569654
  },
  {
    type: "video",
    source: "url",
    url: "http://cdn.playbuzz.com/content/feed/video-1.mp4",
    views: 8820
  },
  {
    title: "Be a winner!",
    type: "video",
    source: "youtube",
    views: 12451409
  },
  {
    title: "Top 10 fastest cars in the world",
    type: "video",
    source: "youtube",
    videoId: "h8MbhS5XKow",
    views: 25560867
  },
  {
    title: "A funny dog barking",
    type: "video",
    source: "youtube",
    videoId: "MveqXxB12YA",
    views: 4287171
  }
];

console.log(items[0]);

class MediaPlayer extends Component {
  state = {};
  render() {
    return {};
  }
}

export default MediaPlayer;
